import React from "react"
import {  Routes, Route ,Navigate} from "react-router-dom";
import Calculator from "../Components/Calculator/calculator";
import Home from "../Components/home";
//import ReqLogin from "../Components/ReqLogin";
import ParentComponent from "../Components/ParentChild/ParentComponent";
//import ParentDataKaryawan from "../Components/ParentChild/parentData";
import Header from "../Header/header";
import Sidebar from "../Sidebar/sidebar";
import SignIn from "../Components/signIn";


const RoutesPath = (props) => {

  return (
    <div>
        <Header/>
        <Sidebar/>
      <Routes>      
        <PrivateRoute path='/login' element={<SignIn/>}/>
        <PrivateRoute path='/home' element={<Home/>}/>
        <PrivateRoute path='/calculator' element={<Calculator/>}/>
        <PrivateRoute path='/parentchild' element={<ParentComponent/>}/>
       
    </Routes>
    </div>
  )
};
const PrivateRoute = ({ component: Component, ...rest }) => (
   
    <Route
    
      {...rest}
      render={props =>
        localStorage.getItem('token')!=null? (
          <Component {...props} />
        ) : (
          <Navigate
            to={{
              pathname: "/login",
              state: { from: props.location }
            }}
          />
        )
      }
    />
  );

export default RoutesPath
